import * as React from "react";
import { styled } from "@mui/material/styles";
import ArrowForwardIosSharpIcon from "@mui/icons-material/ArrowForwardIosSharp";
import MuiAccordion from "@mui/material/Accordion";
import MuiAccordionSummary from "@mui/material/AccordionSummary";
import MuiAccordionDetails from "@mui/material/AccordionDetails";
import { Typography, Box } from "@mui/material";

// Styled components for the Accordion
const Accordion = styled((props) => (
    <MuiAccordion disableGutters elevation={0} square {...props} />
))(({ theme }) => ({
    border: `1px solid ${theme.palette.divider}`,
    borderRadius: "8px",  // Adding border radius for smooth corners
    marginBottom: theme.spacing(2),  // Better separation between FAQs
    "&:not(:last-child)": {
        borderBottom: 0,
    },
    "&:before": {
        display: "none",
    },
}));

const AccordionSummary = styled((props) => (
    <MuiAccordionSummary
        expandIcon={<ArrowForwardIosSharpIcon sx={{ fontSize: "1rem" }} />}
        {...props}
    />
))(({ theme }) => ({
    backgroundColor: theme.palette.mode === "dark"
        ? "rgba(255, 255, 255, .05)"
        : "rgba(0, 0, 0, .03)",
    flexDirection: "row-reverse",
    padding: theme.spacing(2),  // Increased padding for more breathing room
    "&:hover": {
        backgroundColor: "#f5f5f5",  // Lighter hover effect for better UI
    },
    "& .MuiAccordionSummary-expandIconWrapper.Mui-expanded": {
        transform: "rotate(90deg)",
    },
    "& .MuiAccordionSummary-content": {
        marginLeft: theme.spacing(2),
        fontWeight: "bold",  // Bold the FAQ titles
    },
}));

const AccordionDetails = styled(MuiAccordionDetails)(({ theme }) => ({
    padding: theme.spacing(2),
    backgroundColor: "#fafafa",  // Light background for answers
    borderTop: "1px solid rgba(0, 0, 0, .125)",
    borderRadius: "0 0 8px 8px",  // Rounded corners at the bottom
}));

const FaqSection = () => {
    const [expanded, setExpanded] = React.useState("panel1");

    const handleChange = (panel) => (event, newExpanded) => {
        setExpanded(newExpanded ? panel : false);
    };

    return (
        <Box sx={{ py: 8, mx: "auto", width: { xs: "90%", sm: "80%" } }} id="faqsection">
            {/* Section Title */}
            <Box
                sx={{
                    fontWeight: "bold",
                    color: "#363636",
                    mb: 5,
                    typography: { sm: "h4", xs: "h5" },
                    textAlign: "center",
                }}
                component="div"
            >
                Frequently Asked Questions
            </Box>

            {/* Accordion Items */}
            <Accordion expanded={expanded === "panel1"} onChange={handleChange("panel1")}>
                <AccordionSummary aria-controls="panel1d-content" id="panel1d-header">
                    <Typography>What is Alkebuleum?</Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        Alkebuleum is an impact-driven blockchain designed to tackle institutional corruption, resource mismanagement, and facilitate commerce, particularly in Africa and its diaspora.
                    </Typography>
                </AccordionDetails>
            </Accordion>
            <Accordion expanded={expanded === "panel2"} onChange={handleChange("panel2")}>
                <AccordionSummary aria-controls="panel2d-content" id="panel2d-header">
                    <Typography>How do I join the network?</Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        To join the Alkebuleum blockchain network, simply visit our sign-up page, create an account, and follow the steps to start participating in the ecosystem.
                    </Typography>
                </AccordionDetails>
            </Accordion>
            <Accordion expanded={expanded === "panel3"} onChange={handleChange("panel3")}>
                <AccordionSummary aria-controls="panel3d-content" id="panel3d-header">
                    <Typography>How can I download the whitepaper?</Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        You can download the Alkebuleum whitepaper directly from the download section on our website. It contains detailed information about our vision, technology, and economic model.
                    </Typography>
                </AccordionDetails>
            </Accordion>
        </Box>
    );
};

export default FaqSection;
